import {Container} from 'react-bootstrap';


const Partie1 = () => {
	return (
        <div className="part1">
        <div className="par1">
            <Container>
        <h1>Enjoy Thoughtful <br></br> Entertainment</h1>
        <h3>Stream thousands of films for free, thanks to <br></br> the generous support of your public library or <br></br>university</h3>
         </Container>
          </div>
          <div  className="part2">
              <div className="parti2">
          <h1>Start streaming movies today <br></br> with your public library card <br></br> or university login</h1>
          <p>We partner with public libraries and universities <br></br> to bring you ad-free films and series that can <br></br> be enjoyed on your TV, mobile phone, tablet <br></br> and online.</p>
          <button className="BTN">GET STARTED</button>
          </div>
          </div>
          <h4>Enjoy critically-acclaimed movies, <br></br> inspiring documentaries, award-winning foreign films and more</h4>
      </div>
	);
};



